import React from 'react'

const Comments = (props) => {

    return (
        <div>
            {props.comments && props.comments.map(comment =>
            console.log("comment is", {comment}),
                <li key={comment.id}>{comment.message}</li>
            )}
        </div>
    )

}

export default Comments
